namespace std {
std::ostream& operator<<(std::ostream& os, const std::vector<uint8_t>& value)
{
    os << std::endl;
    ghc::hexDump(os, value.data(), value.size());
    return os;
}

std::ostream& operator<<(std::ostream& os, const std::optional<std::vector<uint8_t>>& value)
{
    if (!value) {
        os << "<empty>";
    }
    else {
        os << *value;
    }
    return os;
}
}
namespace ghc {
std::ostream& operator<<(std::ostream& os, const ghc::span<const uint8_t>& value)
{
    os << std::endl;
    ghc::hexDump(os, value.data(), value.size());
    return os;
}
}

